script: |
  super -f text -I q68.spq | sort > q68.out

inputs:
  - name: q68.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT col0 NOT IN ( + - 65 * col2 / - col2 + + col0, + col2 + + col2 + 86, + CAST ( CAST ( - - 12 AS INTEGER ) AS REAL ), + col1, - CAST ( + col2 AS INTEGER ), col1 );
  - name: tab2

outputs:
  - name: q68.out
    data: |
